webpackJsonp([0xd66fdd636a01],{3624:function(a,t){a.exports={data:{markdownRemark:{html:"<p>システム手帳サイズ、電池駆動で携帯可能なGS音源。音色だけならSC-55並だが、携帯できる辺りが素晴らしいと思える。出先でふと音のフレーズが浮かんだ時即座に記録できるようにと購入したもの。 だがシーケンサが余りに使いづらく、数ヶ月で手放すことに。以降出先で音のフレーズが浮かんだら携帯電話と言う名の「ICレコーダ」に。皆さんも真似してみてはいかがでしょう？</p>",frontmatter:{cover:null,date:"2003-01-28T00:00:00+09:00",strDate:"2003/1/27",title:"(2003) Roland PMA-5"}}},pathContext:{path:"/ja/blog/2003/01/28-pma-5/",langKey:"ja"}}}});
